import React from "react";
import recipes from "../recipes";
const Menu = () => {
  return (
    <div className="menu-container">
      <div>
        <h2>This week specials!</h2>
        <button>Menu</button>
      </div>

      <div>
        {recipes.map((recipe) => (
          <div key={recipe.id}>
            <img src={recipe.image} alt="" />
            <div>
              <h5>{recipe.title}</h5>
              <p>{recipe.price}</p>
            </div>
              <p>{recipe.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Menu;
